	add("plan", "{\"term\":\"plan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027plan|lang\u003dfr\u0027 () from \u0027plan|lang\u003dfr\u0027 () a later form of the vernacular \u0027\u0027 from Latin \u0027planus\u0027 (flat, plane) see plain, plane.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A drawing showing technical details of a building, machine, etc., with unwanted details omitted, and often using symbols rather than detailed drawing to represent doors, valves, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027plans\u0027\u0027 for many important buildings were once publicly available\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A set of intended actions, usually mutually related, through which one expects to achieve a goal\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He didn\u0027t really have a \u0027\u0027plan\u0027\u0027; he had a goal and a habit of control\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A two-dimensional drawing of a building as seen from above with obscuring or irrelevant details such as roof removed, or of a floor of a building, revealing the internal layout; as distinct from the elevation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Seen in \u0027\u0027plan\u0027\u0027, the building had numerous passageways not apparent to visitors\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A method; a way of procedure; a custom\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Wordswort\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The simple \u0027\u0027plan\u0027\u0027, / That they should take who have the power, / And they should keep who can\", \"priority\":9}]}, \"synonyms\":{}}");

