	add("placename", "{\"term\":\"placename\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|place|name|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The name of a place; a word or phrase which indicates a particular location or position\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Often, the name of a nationality is derived from its \u0027\u0027placename\u0027\u0027, or vice versa\", \"priority\":2}]}, \"synonyms\":{}}");

	add("placenta", "{\"term\":\"placenta\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027placenta uterina\u0027 (uterine cake) from Latin \u0027placenta\u0027 (flat cake) because of the flat round shape of the afterbirth.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vascular organ in mammals, except monotremes and marsupials, present only in the female during gestation. It supplies food and oxygen from the mother to the foetus, and passes back waste. It is implanted in the wall of the uterus and links to the foetus through the umbilical cord. It is expelled after birth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In flowering plants, the part of the ovary where ovules develop; in non-flowering plants where the spores develop\", \"priority\":2}]}, \"synonyms\":{}}");

