	add("plague", "{\"term\":\"plague\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"middle high german (ca. 1050-1500)\", \"middle low german\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027plage\u0027 from Old french (842-ca. 1400) {{m|fro|plage}}, from {{attention|la}} {{m|la|plāga||blow, wound}}, from {{m|la|plango|plangō|to strike}}. Cognate with Middle dutch (ca. 1050-1350) {{m|dum|plaghe|plāghe}} (\u0026gt; Dutch {{m|nl|plaag}}), {{m|dum|plaghen|plāghen}} (\u0026gt; Dutch {{m|nl|plagen}}); Middle low german {{m|gml|plāge}}, {{m|gml|pflāge}}, {{m|gml|vlāge}}; Middle high german (ca. 1050-1500) {{m|gmh|plāge}} (\u0026gt; German {{m|de|Plage}}), {{m|gmh|plāgen}} (\u0026gt; German \u0027plagen\u0027 ; Swedish {{m|sv|plåga}}; French {{m|fr|plaie}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bubonic plague, the pestilent disease caused by the virulent bacterium \u0027Yersinia pestis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An epidemic or pandemic caused by any pestilence, but specifically by the above disease\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A widespread affliction, calamity or destructive influx, especially when seen as divine retribution\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Ten Biblical \u0027\u0027plagues\u0027\u0027 over Egypt, ranging from locusts to the death of the crown prince, finally forced Pharaoh to let Moses\u0027s people go\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A grave nuisance, whatever greatly irritate\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Bart is an utter \u0027\u0027plague\u0027\u0027; his pranks never cease\", \"priority\":6}]}, \"synonyms\":{}}");

