	add("plainsies", "{\"term\":\"plainsies\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Diminutive of \u0027plain\u0027 Compare \u0027halfsies\u0027 \u0027swapsies\u0027 etc.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In children\u0027s games, such as jacks, the simplest style of play, without additional actions such as clapping\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, Marta Weigle, \u0027Follow my fancy: the book of jacks and jack games\u0027 (page 22\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When you have mastered \u0027\u0027plainsies\u0027\u0027, the regular jack game, and have learned all the rules, you will be ready to use this part of the book. A fancy is a variation of plainsies which usually requires more skill than plainsies does\", \"priority\":3}]}, \"synonyms\":{}}");

	add("plaint", "{\"term\":\"plaint\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Middle english (1100-1500) \u0027plainte\u0027 from Anglo-norman \u0027plainte\u0027 (lamentation) \u0027plaint\u0027 (lament) and Old french (842-ca. 1400) \u0027pleinte\u0027 (lamentation) \u0027pleint\u0027 () (modern French \u0027plainte\u0027 , from \u0027plancta\u0027 (plaint) Latin \u0027planctus\u0027 (a beating of the breast in lamentation, beating, lamentation) from Latin \u0027plangere\u0027 (to beat the breast, lament) see plain.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lament or woeful cry. \u0026lt;!--ISBN 0-399-15232-6 page 499--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1827\u0027\u0027, Maria Elizabeth Budden, [http://books.google.co.uk/books?id\u003dGLYNAAAAYAAJ \u0027Nina, An Icelandic Tale\u0027], page 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the first paroxysm of his grief, Ingolfr exclaimed, (what sorrowing heart has not echoed his \u0027\u0027plaint\u0027\u0027?) that he could never more taste of joy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A complaint\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Henry James, \u0027What Maisie Knew\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"she seemed to repeat, though with perceptible resignation, her \u0027\u0027plaint\u0027\u0027 of a moment before. ‘Your father, darling, is a very odd person indeed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An accusation\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Once the \u0027\u0027plaint\u0027\u0027 had been made there was nothing that could be done to revoke it\", \"priority\":8}]}, \"synonyms\":{}}");

	add("plameology", "{\"term\":\"plameology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A 2003 neologism combining \u0026quot;Plame\u0026quot; (for \u0026quot;Valerie Plame\u0026quot;) with the suffix \u0026quot;-ology.\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study and analysis of the ongoing CIA leak scandal, also known as the Plame affair, by members of the Internet blogging community\", \"priority\":1}]}, \"synonyms\":{}}");

	add("plant", "{\"term\":\"plant\", \"etymology\":{\"influencers\":[{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"Icelandic\", \"Latin\", \"Dutch\", \"Swedish\"], \"text\":\"Old english (ca. 450-1100) \u0027plante\u0027 (young tree or shrub, herb newly planted) fom Latin \u0027planta\u0027 (sprout, shoot, cutting) Broader sense of \u0026quot;any vegetable life, vegetation generally\u0026quot; is from French \u0027plante\u0027 The verb is from Middle english (1100-1500) \u0027planten\u0027 from Old english (ca. 450-1100) \u0027plantian\u0027 (to plant) from Latin \u0027plantare\u0027 later influenced by Old french (842-ca. 1400) \u0027planter\u0027 Compare also Dutch \u0027planten\u0027 (to plant) German \u0027pflanzen\u0027 (to plant) Swedish \u0027planta\u0027 (to plant) Icelandic \u0027planta\u0027 (to plant)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organism that is not an animal, especially an organism capable of photosynthesis. Typically a small or herbaceous organism of this kind, rather than a tree\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dIn \u0027\u0027plants\u0027\u0027, the ability to recognize self from nonself plays an important role in fertilization, because self-fertilization will result in less diverse offspring than fertilization with pollen from another individual. Many genes with reproductive roles also have antibacterial and immune functions, which indicate that the threat of microbial attack on the sperm or egg may be a major influence on rapid evolution during reproduction\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An organism of the kingdom \u0027Plantae\u0027; now specifically, a living organism of the \u0027Embryophyta\u0027 (land plants) or of the \u0027Chlorophyta\u0027 (green algae), a eukaryote that includes double-membraned chloroplasts in its cells containing chlorophyll \u0027a\u0027 and \u0027b\u0027, or any organism closely related to such an organism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Now specifically, a multicellular eukaryote that includes chloroplasts in its cells, which have a cell wall\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any creature that grows on soil or similar surfaces, including plants and fungi\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A factory or other industrial or institutional building or facility\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An object placed surreptitiously in order to cause suspicion to fall upon a person\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Anyone assigned to behave as a member of the public during a covert operation (as in a police investigation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A person, placed amongst an audience, whose role is to cause confusion, laughter etc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A play in which the cue ball knocks one (usually red) ball onto another, in order to pot the second; a set\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Phil Yates, \u0027The Times\u0027, April 28 2008\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"O’Sullivan risked a \u0027\u0027plant\u0027\u0027 that went badly astray, splitting the reds\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A large piece of machinery, such as the kind used in earthmoving or construction\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A young tree; a sapling; hence, a stick or staff\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027plant\u0027\u0027 of stubborn oa\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The sole of the foot\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"knotty legs and \u0027\u0027plants\u0027\u0027 of cla\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A plan; a swindle; a trick\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"It wasn\u0027t a bad \u0027\u0027plant\u0027\u0027, that of mine, on Fikey\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An oyster which has been bedded, in distinction from one of natural growth\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A young oyster suitable for transplanting\", \"priority\":21}]}, \"synonyms\":{}}");

	add("planarian", "{\"term\":\"planarian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027planaria\u0027 (from \u0027planarius\u0027 () from Latin \u0027planum\u0027 {{suffix||an|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various flatworms of the order \u0027\u0027 living in marine, freshwater, or terrestrial environments\", \"priority\":1}]}, \"synonyms\":{}}");

	add("planchette", "{\"term\":\"planchette\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small plank\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of Ouija board. (A small tablet of wood supported on casters and having a pencil attached. The characters produced by the pencil on paper, while the hand rests on the instrument and it is allowed to move, are sometimes interpreted as of oracular or supernatural import\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A plane-table\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Circular, colored dots pressed into paper money, used to distinguish authentic currency from counterfeit currency\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027 ,\u0026quot;[http://web.archive.org/web/20101229145602/http://www.cbc.ca/canada/manitoba/story/2009/11/26/mb-counterfeit-cash-winnipeg.html Warning issued about fake cash],\u0026quot; \u0027CBCNews\u0027 (Canada), 26 Nov\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Some general security features to look for in both Canadian and American currency are . . .small green dots or \u0026quot;\u0027\u0027planchettes\u0027\u0027\u0026quot; randomly embedded throughout the paper that glow under ultraviolet light\", \"priority\":6}]}, \"synonyms\":{}}");

	add("planck", "{\"term\":\"planck\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The w:Planck units of measure eponymous of Max Planck\", \"priority\":1}]}, \"synonyms\":{}}");

	add("planeful", "{\"term\":\"planeful\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plane|ful|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Enough to fill an aeroplane\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I had to fly a \u0027\u0027planeful\u0027\u0027 of recruits to the army base\", \"priority\":2}]}, \"synonyms\":{}}");

	add("planemo", "{\"term\":\"planemo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Contraction of \u0027planetary-mass object\u0027. Coined by w:Gibor Basri|Gibor Basri, Professor of Astronomy at the w:University of California, Berkeley|University of California, Berkeley, (UCB) at the 2003 w:International Astronomical Union|IAU conference.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an astronomical object with enough mass to achieve hydrostatic equilibrium, but not enough to initiate core fusion at any time in its existence. That is, it is rounded in shape and is smaller than a star. Planemos include planets, dwarf planets, and the larger moons of the Solar System, but also sub-brown dwarfs and rogue planets between the stars\", \"priority\":1}]}, \"synonyms\":{}}");

	add("planespotting", "{\"term\":\"planespotting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|plane|spotting|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The observation and logging of the registration numbers (tailnumbers) of aircraft as a hobby\", \"priority\":1}]}, \"synonyms\":{}}");

	add("planet", "{\"term\":\"planet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\", \"Norwegian\", \"old norse\"], \"text\":\"From Middle english (1100-1500) {{m|enm|planete}}, from Old french (842-ca. 1400) {{m|fro|planete}}, from Latin {{m|la|planeta}}, {{m|la|planetes}}, from Ancient greek (to 1453) {{m|grc|πλανήτης}} variant of {{m|grc|πλάνης||wanderer, planet}}, from Ancient greek (to 1453) {{m|grc|πλανάω||wander about, stray}}, of unknown origin. Perhaps from a Proto-indo-european {{m|ine-pro|*pel-||to wander, roam}}, cognate with Latin {{m|la|pālor||wander about, stray}}, Old norse {{m|non|flana||to rush about}}, Norwegian {{m|no|flanta||to wander about}}. More at {{l|en|flaunt}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Each of the seven major bodies which move relative to the fixed stars in the night sky—the Moon, Mercury, Venus, the Sun, Mars, Jupiter and Saturn\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Be they not dreames of humane vanity,to make of our knowne earth a bright shining \u0027\u0027planet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, \u0027Tom Jones\u0027, Folio Society, 1973, p.288\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The moonbegan to rise from her bed, where she had slumbered away the day, in order to sit up all night. Jones had not travelled far before he paid his compliments to that beautiful \u0027\u0027planet\u0027\u0027, and, turning to his companion, asked him if he had ever beheld so delicious an evening\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society, 2012, p.361\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Another of Boehme\u0027s followers, the Welshman Morgan Llwyd, also believed that the seven \u0027\u0027planets\u0027\u0027 could be found within man\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A body which orbits the Sun directly and is massive enough to be in hydrostatic equilibrium (effectively meaning a spheroid) and to dominate its orbit; specifically, the eight major bodies of Mercury, Venus, Earth, Mars, Jupiter, Saturn, Uranus, and Neptune. (Pluto was considered a planet until 2006 and has now been reclassified as a dwarf planet\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1640\u0027\u0027, (title\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A Discovrse concerning a New \u0027\u0027Planet\u0027\u0027. Tending to prove, That \u0027tis probable our Earth is one of the \u0027\u0027Planets\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Alok Jha, \u0027The Guardian\u0027, 22 December\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Their decision will force a rewrite of science textbooks because the solar system is now a place with eight \u0027\u0027planets\u0027\u0027 and three newly defined \u0026quot;dwarf \u0027\u0027planets\u0027\u0027\u0026quot;\u0026amp;mdash;a new category of object that includes Pluto\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A large body which directly orbits any star (or star cluster) but which has not attained nuclear fusion\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"In phrases such as \u0027the planet\u0027, \u0027this planet\u0027, sometimes refers to the Earth\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"quot;My tastes,\u0026quot; he said, still smiling, \u0026quot;incline me to the garishly sunlit side of this \u0027\u0027planet\u0027\u0027.\u0026quot; And, to tease her and arouse her to combat: \u0026quot;I prefer a farandole to a nocturne; I\u0027d rather have a painting than an etching; Mr. Whistler bores me with his monochromatic mud; I don\u0027t like dull colours, dull sounds, dull intellects;.\u0026quot\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.guardian.co.uk/books/2013/may/18/falling-upwards-richard-holmes-review Fantasy of passage\u003dIt is tempting to speculate about the incentives or compulsions that might explain why anyone would take to the skies in [the] basket [of a balloon]:; perhaps to moralise on the oneness or fragility of the \u0027\u0027planet\u0027\u0027, or to see humanity for the small and circumscribed thing that it is\", \"priority\":16}]}, \"synonyms\":{}}");

	add("planetarium", "{\"term\":\"planetarium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From formed from {{suffix|planet|arium|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A display museum in which images of stars and other astronomical phenomena are projected onto a domed ceiling\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An orrery\", \"priority\":2}]}, \"synonyms\":{}}");

	add("planetoid", "{\"term\":\"planetoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|planet|oid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An asteroid of any siz\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027 \u0027Tsunami generation by pelagic \u0027\u0027planetoid\u0027\u0027 impact\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An asteroid-like body in an orbit beyond the asteroid belt, such as a centaur or Kuiper belt objec\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A larger, planetary, body in orbit around the Sun, such as Vesta or (candidate) dwarf planets such Eris or Sedn\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027 \u0027Optimal trajectories for an ion driven spacecraft from earth to the \u0027\u0027planetoid\u0027\u0027 Vesta\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A dwarf plane\", \"priority\":6}]}, \"synonyms\":{}}");

	add("planetology", "{\"term\":\"planetology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the study of planets, planetary systems and the solar system\", \"priority\":1}]}, \"synonyms\":{}}");

	add("planetree", "{\"term\":\"planetree\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|plane|tree|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various trees of the genus \u0027Platanus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("planimetry", "{\"term\":\"planimetry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|plani|metry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The measurement of distances, angles and areas on a plane, especially on a map\", \"priority\":1}]}, \"synonyms\":{}}");

	add("planking", "{\"term\":\"planking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plank|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A series of planks; a group of planks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The practice of lying face down with arms to the sides, in unusual public spaces, and taking photographs to record the act\", \"priority\":2}]}, \"synonyms\":{}}");

	add("planktivore", "{\"term\":\"planktivore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plankton|vore|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An animal feeding primarily on plankton, such as a blue whale\", \"priority\":1}]}, \"synonyms\":{}}");

	add("planktivory", "{\"term\":\"planktivory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|planktivore|y|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The eating of plankton\", \"priority\":1}]}, \"synonyms\":{}}");

