	add("platypnea", "{\"term\":\"platypnea\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"shortness of Shortness of breath that occurs when the patient is upright. The word is derived from the Greek platus (\u003d flat) and pnoia (\u003dbreath\", \"priority\":1}]}, \"synonyms\":{}}");

	add("platypus", "{\"term\":\"platypus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{m|la|Platypus}} (originally a genus name, but already used for a type of beetle), from Ancient greek (to 1453) {{m|grc|πλατύπους||flat-footed}}, from {{m|grc|πλατύς||flat}} + {{m|grc|πούς||foot}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A semi-aquatic, egg-laying mammal of action with a bill resembling that of a duck, that has a mole-like body, a tail resembling that of a beaver, a waterproof pelt, and flat webbed feet \u0026amp;mdash; males have poisonous spurs on the inside of the back legs; \u0027Ornithorhynchus anatinus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("plaudit", "{\"term\":\"plaudit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla\u0027 second-person plural imperative of \u0027lang\u003dla|plaudere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mark or expression of applause; praise bestowed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1862\u0027\u0027, Washington Irving, \u0027Works of Washington Irving\u0027, page 490\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The roof now rung with bravos, handkerchiefs were waved on every side, “three cheers,” again and again, and \u0027\u0027plaudit\u0027\u0027 upon \u0027\u0027plaudit\u0027\u0027 following in such quick succession, begun, ended, and begun again, that it was some time before the toast with which Mr. Irving concluded, could be heard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Edgar Rice Burroughs, \u0027The Gods of Mars\u0027, page 109\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They were very orderly- there were neither scoffs nor \u0027\u0027plaudits\u0027\u0027, and when they saw us at the window above them there were many who buried their faces in their arms and wept\", \"priority\":5}]}, \"synonyms\":{}}");

	add("plautdietsch", "{\"term\":\"plautdietsch\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"plautdietsch\"], \"text\":\"From Plautdietsch Cognate to Dutch low saxon \u0027platduuts\u0027 and German low german \u0027plattdüütsch\u0027 as well as to High German \u0027plattdeutsch\u0027 (whence English \u0027plattdeutsch\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mennonite Low German, a variety of Low Prussian East Low German that developed in w:Royal Royal Prussia and which is now spoken by communities not only in Germany but also in Canada, the United States, Argentina, Brazil, Russia and some other countries\", \"priority\":1}]}, \"synonyms\":{}}");

	add("plautus", "{\"term\":\"plautus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Roman comic playwright (c. 254 – 184 BC) of the Old Latin period\", \"priority\":1}]}, \"synonyms\":{}}");

	add("playability", "{\"term\":\"playability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|play|ability|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or property of being playable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A measure of either the ease by which a video game may be played, or of the overall quality of its gamepla\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Mutant Chickens from Mars has great graphics, but the \u0027\u0027playability\u0027\u0027 is lacking\", \"priority\":3}]}, \"synonyms\":{}}");

	add("playboating", "{\"term\":\"playboating\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|play|boating|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of whitewater kayaking or canoeing where the paddler performs various technical moves in one place (a playspot), rather than travelling the length of a section of river\", \"priority\":1}]}, \"synonyms\":{}}");

	add("playboy", "{\"term\":\"playboy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who does not work, but devotes himself to a life of leisure and pleasure, often sexual, without commitments or responsibilities\", \"priority\":1}]}, \"synonyms\":{}}");

	add("playdough", "{\"term\":\"playdough\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|play|dough|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"modeling Modeling clay for children\", \"priority\":1}]}, \"synonyms\":{}}");

	add("player", "{\"term\":\"player\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027playere\u0027 from Old english (ca. 450-1100) {{m|ang|pleġere||player, athlete, wrestler}}, equivalent to {{suffix|play|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One that play\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who plays any game or sport\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An actor in a dramatic play\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who plays on a musical instrument\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A gamer; a gamester\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A gambler\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A mechanism that actuates a player piano or other automatic musical instrument\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An electronic device or software application that plays audio and/or video media, such as CD player\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"One who is playful; one without serious aims; an idler; a trifler\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A significant participant\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"He thought he could become a \u0027\u0027player\u0027\u0027, at least at the state level\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A person who play the plays the field rather than having a long-term sexual relationship\", \"priority\":12}]}, \"synonyms\":{}}");

	add("playette", "{\"term\":\"playette\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|play|ette|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short play (dramatic work\", \"priority\":1}]}, \"synonyms\":{}}");

	add("playground", "{\"term\":\"playground\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Appendix:Glossar. compound|Compound of {{compound|play|ground|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large open space to play on, usually for children\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A yard or other open-air space on a school campus where the children can play, especially during break\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Small area with dedicated play equipment, usually for childre\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The city park \u0027\u0027playgrounds\u0027\u0027 offer various slides, tubes and swings\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any physical or metaphysical space in which a person or organization has free rein to do as they please\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The exclusive tropical island was a millionaire\u0027s \u0027\u0027playground\", \"priority\":6}]}, \"synonyms\":{}}");

	add("playhouse", "{\"term\":\"playhouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|play|house|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A theater; a venue for performing plays\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A toy house for children to play in; a cubby house or Wendy house\", \"priority\":2}]}, \"synonyms\":{}}");

	add("playing", "{\"term\":\"playing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|play|ing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An occasion on which something, such as a song or show, is played\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the Nielsen figures show that average viewership across all \u0027\u0027playings\u0027\u0027 fell by only 40 percent and that total viewership of the entire season’s episodes fell by only 20 percent\", \"priority\":2}]}, \"synonyms\":{}}");

	add("playlet", "{\"term\":\"playlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|play|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short play (dramatic work\", \"priority\":1}]}, \"synonyms\":{}}");

