	add("playlistism", "{\"term\":\"playlistism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|playlist|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of judging other people based on the contents of their music playlist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, w:Leander Leander Kahney, \u0026quot;[http://www.macworld.com/article/1047783/cult.html The Cult of iPod]\u0026quot;, \u0027Playlist\u0027, 2 November 2005\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This has lead to a new kind of music snobbery called \u0027\u0027\u0027playlistism\u0027\u0027\u0027. Music snobs amuse themselves by laughing at a colleague\u0027s collection of showtunes, or the hopelessly pretentious jazz of the goatee-ed guy at the other end of the dorm\", \"priority\":3}]}, \"synonyms\":{}}");

